import React from 'react';
import './header.css';

class Header extends React.Component<any, any> {
	logOut(){
		sessionStorage.clear();	
	}
    render(){
        return (
			
			<nav className="navbar navbar-expand-sm bg-dark navbar-dark">
				<ul className="navbar-nav" style={{width: "100%"}}>
					<div className="row" style={{width: "100%"}}>
						<div className="col-sm-11">
							<form className="form-inline my-2 my-lg-0">
								<input className="form-control mr-sm-2" type="text" placeholder="Search" aria-label="Search"/>
								<button className="btn btn-outline-success my-2 my-sm-0" type="submit" style={{fontSize: "15px", width: "60px"}}>Search</button>
							</form>	
						</div>
						<div className="col-sm-1" style={{display: "contents"}}>
							<div className="icon-admin"></div>
							<li className="nav-item dropdown" style={{margin: "9px"}}>
								
								<a className=" dropdown-toggle style-item" href="#" id="navbardrop" data-toggle="dropdown">Quản trị</a>
								<div className="dropdown-menu">
									<a className="dropdown-item" href="/setting">Thiết lập</a>
									<a className="dropdown-item" href="/login" onClick={this.logOut}>Đăng xuất</a>
								</div>
							</li>
						</div>
					</div>
				</ul>
			</nav>
        );
    }

}

export default Header;
